export default class extends React.Component {
    render() {
        return (
            <>
                <nav id='menu'>
                    <ul>
                        <li>
                            <button type='button'></button>
                            <ul>
                                <li><button>Hola</button></li>
                                <li><button>Hola</button></li>
                                <li><button>Hola</button></li>
                            </ul>
                        </li>
                    </ul>
                </nav>
        <style jsx>{`
            #menu button {
                width: 2.5rem;
                height: 2.5rem;
                border-radius:150px;
                border: 1px solid;
            }
        `}</style>
            </>
        );
    }
}
